function Modalconfirm() {

    const stylecontainer = {
        position:'absolute',
        top:'0',
        bottom:'0',
        right:'0',
        left:'0'
    }

    const stylediv = {
        width:'500px',
        borderRadius: '10px',
        boxShadow: '0px 3px 3px 1px rgba(128, 128, 128, 0.75)',
        padding:'40px'
    }


    const imgStyle = {
        width: '100%', 
        height: 'auto' 
      };

 


    return (
       <div className='d-flex flex-row justify-content-center align-items-center' style={stylecontainer}>
            
       </div>
    )

}

export default Modalconfirm;
